import React, { useState } from 'react';


const List = (props) => {
    const [line,setLine] = useState(false);
    const cut = () => {
        setLine(true);
    }
    return (
        <>
            <div className='btnlist'>
                <button className='btn' onClick={cut} onDoubleClick={()=>props.delete(props.id)}>&times;</button><li className='list' style={{textDecoration:line?'line-through':'none',color:line?'gray':none}}>{props.value}</li>
            </div>
        </>
    );
}
export default List;
